import pandas as pd
import re

def extract_version_info(name):
  # Updated regex to capture optional parts correctly
  match = re.search(r'spark(-(\w+))?(-(\w+))?-(\d+)\.(\d+)\.(\d+)(/)?', name)
  if match:
    # Extract major, minor, and patch versions
    major = int(match.group(5)) if match.group(5) else None
    minor = int(match.group(6)) if match.group(6) else None
    patch = int(match.group(7)) if match.group(7) else None

    # Construct the version string, handling potential None values
    version_parts = [str(major) if major is not None else '',
                       str(minor) if minor is not None else '',
                       str(patch) if patch is not None else '']
    version = '.'.join(part for part in version_parts if part)

    return major, minor, patch, version
  else:
    # Return None or appropriate values for names that don't match the pattern
    return None, None, None, None


df = pd.read_csv('spark_releases.txt', usecols=[0,1], sep="\s+", header=None)
df.columns = ['Name', 'Date']
df['Date'] = pd.to_datetime(df['Date'])
df['Name'] = df['Name'].str.rstrip('/')
df[['major', 'minor', 'patch', 'version']] = df['Name'].apply(lambda x: pd.Series(extract_version_info(x)))
